import { StyleSheet, View } from "react-native";

const styles = StyleSheet.create({
  formContext: {
    height: "100%",  
    width: "100%",
    bottom: 0,
    alignItems: "center",
    backgroundColor: "#fff",
    borderTopLeftRadius: 30,
    borderTopRightRadius: 30,
    marginTop: 10,
  },
  form: {
    height: "auto",
    width: "100%",
  }
});

export default styles;
